import { Component } from '@angular/core';

@Component({
  selector: 'app-task3',
  templateUrl: './task3.component.html',
  styleUrls: ['./task3.component.css']
})
export class Task3Component {

}
<h2>Мови:</h2>
<ul>
  <li *ngFor="let lang of langsArray">{{ lang }}</li>
</ul>

<h2>Міста та їх країни:</h2>
<ul>
  <li *ngFor="let city of Object.keys(cities)">
    {{ city }}: {{ cities[city] }}
  </li>
</ul>
